package NewRohiniExamples;

public class Switch {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
     int h=90;
     
    switch(h){ 
    case 0:
    	System.out.println("h value is 30");
    	break;
    case 1:
    	System.out.println("h value is 60");
    	break;
    case 90:
    	System.out.println("h value is 90");
    	break;
    default:
    	System.out.println("h has no value");
    }
    
	}

}
